import { Typography, TextField, InputAdornment, Checkbox, FormGroup } from '@mui/material';
import { useTranslation } from 'react-i18next';
// import * as AppActions from 'app/store/actions';
import { makeStyles } from '@mui/styles';

const label = { inputProps: { 'aria-label': 'Checkbox demo' } };

const useStyles = makeStyles({
  titles: {
    paddingLeft: '8px',
  },
  inputNumber: {
    '& input[type=number]::-webkit-inner-spin-button, input[type=number]::-webkit-outer-spin-button':
      {
        '-webkit-appearance': 'none',
        margin: '0',
      },

    '& input[type=number]': {
      '-moz-appearance': 'textfield',
    },
  },
});

export default function Travels(props) {
  const {
    countdown,
    setCountdown,
    advanceVehicle,
    setAdvanceVehicle,
    elapse,
    setElapse,
    speed,
    setSpeed,
    withoutAdvanceVehicle,
    setWithoutAdvanceVehicle,
    withoutElapse,
    setWithoutElapse,
    withoutSpeed,
    setWithoutSpeed,
    useDoorStateAsTrigger,
    setUseDoorStateAsTrigger,
    withoutUseDoorStateAsTrigger,
    setWithoutUseDoorStateAsTrigger,
    validateString,
    validateNumber,
  } = props;
  const { t } = useTranslation('settingPage');
  const classes = useStyles();

  function handleCountdown(event) {
    setCountdown(parseInt(event.target.value, 10));
  }

  function handleAdvanceVehicle(event) {
    setAdvanceVehicle(parseInt(event.target.value, 10));
  }

  function handleElapse(event) {
    setElapse(parseInt(event.target.value, 10));
  }

  function handleSpeed(event) {
    setSpeed(parseInt(event.target.value, 10));
  }

  function handleWithoutAdvanceVehicle(event) {
    setWithoutAdvanceVehicle(parseInt(event.target.value, 10));
  }

  function handleWithoutElapse(event) {
    setWithoutElapse(parseInt(event.target.value, 10));
  }

  function handleWithoutSpeed(event) {
    setWithoutSpeed(parseInt(event.target.value, 10));
  }

  function hanldeUseDoorStateAsTrigger(event, val) {
    if (val === true || val === false) {
      setUseDoorStateAsTrigger(val);
    }
  }

  function hanldewithoutUseDoorStateAsTrigger(event, val) {
    if (val === true || val === false) {
      setWithoutUseDoorStateAsTrigger(val);
    }
  }

  return (
    <div>
      <div className="w-full flex flex-wrap">
        <div
          className={`w-full sm:w-1/2 flex pr-0 sm:pr-10 items-center ${classes.inputNumber} justify-between`}
        >
          <Typography className="w-full">{t('COUNTDOWN')}</Typography>

          <TextField
            id="countdown"
            error={validateNumber(countdown, 0, 60000) !== null}
            helperText={validateNumber(countdown, 0, 60000)}
            sx={{ m: 1, width: '30ch' }}
            type="number"
            value={countdown}
            onChange={handleCountdown}
            InputProps={{
              endAdornment: <InputAdornment position="end">milisegundos</InputAdornment>,
            }}
          />
        </div>

        <div className="w-full">
          <Typography className="leading-none mb-10">
            <b>{t('ROUTE_LOG_GENERATOR')}:</b>
          </Typography>
        </div>

        <div
          className={`w-full sm:w-1/2 flex pr-0 sm:pr-10 items-center ${classes.inputNumber} justify-between`}
        >
          <Typography className="w-full">{t('ADVANCE_VEHICLE')}:</Typography>

          <TextField
            id="advanceVehicle"
            error={validateNumber(advanceVehicle, 0, 10000) !== null}
            helperText={validateNumber(advanceVehicle, 0, 10000)}
            sx={{ m: 1, width: '30ch' }}
            type="number"
            value={advanceVehicle}
            onChange={handleAdvanceVehicle}
            InputProps={{
              endAdornment: <InputAdornment position="end">m</InputAdornment>,
            }}
          />
        </div>

        <div
          className={`w-full sm:w-1/2 flex pl-0 sm:pl-10 items-center ${classes.inputNumber} justify-between`}
        >
          <Typography className="w-full">{t('ELAPSE')}:</Typography>

          <TextField
            id="elapse"
            error={validateNumber(elapse, 0, 86400000) !== null}
            helperText={validateNumber(elapse, 0, 86400000)}
            sx={{ m: 1, width: '30ch' }}
            type="number"
            value={elapse}
            onChange={handleElapse}
            InputProps={{
              endAdornment: <InputAdornment position="end">s</InputAdornment>,
            }}
          />
        </div>

        <div
          className={`w-full sm:w-1/2 flex pr-0 sm:pr-10 items-center ${classes.inputNumber} justify-between`}
        >
          <Typography className="w-full">{t('SPEED')}:</Typography>

          <TextField
            id="speed"
            error={validateNumber(speed, 0, 500) !== null}
            helperText={validateNumber(speed, 0, 500)}
            sx={{ m: 1, width: '30ch' }}
            type="number"
            value={speed}
            onChange={handleSpeed}
            InputProps={{
              endAdornment: <InputAdornment position="end">km/h</InputAdornment>,
            }}
          />
        </div>

        <div className="w-full sm:w-1/2 flex pr-0 sm:pr-10 items-center justify-between">
          <Typography className="w-full">{t('DOOR_STATUS_CHANGE')}</Typography>
          <FormGroup value={useDoorStateAsTrigger} onChange={hanldeUseDoorStateAsTrigger}>
            <Checkbox
              checked={useDoorStateAsTrigger}
              onChange={hanldeUseDoorStateAsTrigger}
              value="useDoorStateAsTrigger"
              inputProps={{
                'aria-label': 'primary checkbox',
              }}
            />
          </FormGroup>
        </div>

        <div className="w-full">
          <Typography className="leading-none mb-10">
            <b>{t('NOT_PATH_LOG_GENERATOR')}:</b>
          </Typography>
        </div>

        <div
          className={`w-full sm:w-1/2 flex pr-0 sm:pr-10 items-center ${classes.inputNumber} justify-between`}
        >
          <Typography className="w-full">{t('ADVANCE_VEHICLE')}:</Typography>

          <TextField
            id="withoutAdvanceVehicle"
            error={validateNumber(withoutAdvanceVehicle, 0, 10000) !== null}
            helperText={validateNumber(withoutAdvanceVehicle, 0, 10000)}
            sx={{ m: 1, width: '30ch' }}
            type="number"
            value={withoutAdvanceVehicle}
            onChange={handleWithoutAdvanceVehicle}
            InputProps={{
              endAdornment: <InputAdornment position="end">m</InputAdornment>,
            }}
          />
        </div>

        <div
          className={`w-full sm:w-1/2 flex pl-0 sm:pl-10 items-center ${classes.inputNumber} justify-between`}
        >
          <Typography className="w-full">{t('ELAPSE')}:</Typography>

          <TextField
            id="withoutElapse"
            error={validateNumber(withoutElapse, 0, 86400000) !== null}
            helperText={validateNumber(withoutElapse, 0, 86400000)}
            sx={{ m: 1, width: '30ch' }}
            type="number"
            value={withoutElapse}
            onChange={handleWithoutElapse}
            InputProps={{
              endAdornment: <InputAdornment position="end">s</InputAdornment>,
            }}
          />
        </div>

        <div
          className={`w-full sm:w-1/2 flex pr-0 sm:pr-10 items-center ${classes.inputNumber} justify-between`}
        >
          <Typography className="w-full">{t('SPEED')}:</Typography>

          <TextField
            id="withoutSpeed"
            error={validateNumber(withoutSpeed, 0, 500) !== null}
            helperText={validateNumber(withoutSpeed, 0, 500)}
            sx={{ m: 1, width: '30ch' }}
            type="number"
            value={withoutSpeed}
            onChange={handleWithoutSpeed}
            InputProps={{
              endAdornment: <InputAdornment position="end">km/h</InputAdornment>,
            }}
          />
        </div>

        <div className="w-full sm:w-1/2 flex pr-0 sm:pr-10 items-center justify-between">
          <Typography className="w-full">{t('DOOR_STATUS_CHANGE')}</Typography>
          <FormGroup
            value={withoutUseDoorStateAsTrigger}
            onChange={hanldewithoutUseDoorStateAsTrigger}
          >
            <Checkbox
              checked={withoutUseDoorStateAsTrigger}
              onChange={hanldewithoutUseDoorStateAsTrigger}
              value="withoutUseDoorStateAsTrigger"
              inputProps={{
                'aria-label': 'primary checkbox',
              }}
            />
          </FormGroup>
        </div>
      </div>
